import React from 'react'

export default function Connexion() {
  return (
    <div>
         <form onSubmit={handleSubmit}>
            <input type="text" placeholder="email" onChange={valueEmail}/>
            <input type="text" placeholder="password" onChange={valuePassword}/>
            <button>connexion</button>
        </form>
    </div>
  )
}
